#include<bits/stdc++.h>
using namespace std;


int possibleSubStr(string s, int k) {
    vector<string>  res;
    for (int i = k; i < s.size(); i++)
    {
        res.push_back(s.substr(i - k, k + 1));
    }

    for (auto it : res) {
        cout << it << endl;
    }

    int maxi = 0;
    for (int i = 0; i < res.size(); i++)
    {
        int count = 0;
        for (int j = 0; j < res[i].size(); j++)
        {
            if (res[i][j] == 'a' || res[i][j] == 'e' || res[i][j] == 'i' || res[i][j] == 'o' || res[i][j] == 'u') {
                count++;
            }
        }
        maxi = max(maxi, count);

    }


    return maxi;
}


int main()
{
    string s = "";
    int k = 7;

    int ans = possibleSubStr(s, k);
    cout << "Total maximum possible vowels present in [" << s << "] is: " << ans << endl;


    return 0;
}